    public ReceiveThread(MainFrame mainFrame, DatagramSocket socket) {
        this.mainFrame  = mainFrame;
        this.socket     = socket;
        this.thread     = new Thread(this);
        this.thread.start();
    }

    @Override
    public void run() {
        byte[]                  receiveData;
        DatagramPacket          receivePacket;
        RawPacket               rawPacket;
        Packet                  packet;
        OsaHeader               osaHeader;
        OsaLogHeader            logHeader;
        OsaLogSubscribeHeader   logSubscribeHeader;

        receiveData             = new byte[1500];
        receivePacket           = new DatagramPacket(receiveData, receiveData.length);

        try {
            while (!socket.isClosed()) {
                if (!USE_STATIC_PACKET) {
                    /* This method blocks until a datagram is received */
                    socket.receive(receivePacket);
                    rawPacket = new RawPacket(receivePacket.getData(), receivePacket.getLength());
                } else {
                    Thread.sleep(100);
                    if (STATIC_PACKET_COUNTER < STATIC_PACKET.length) {
                        rawPacket = new RawPacket(STATIC_PACKET[STATIC_PACKET_COUNTER], STATIC_PACKET[STATIC_PACKET_COUNTER].length);
                        STATIC_PACKET_COUNTER++;

                        System.out.println("=============== " + STATIC_PACKET_COUNTER + " len=" + STATIC_PACKET[STATIC_PACKET_COUNTER - 1].length + " =======================");
                    } else {
                        rawPacket = null;
                    }
                }
                System.out.println("Packet received!");
                packet = Packet.decode(rawPacket);
                System.out.println("Packet decoded!");
                if (packet != null) {
                    if (packet.getHead() instanceof OsaHeader) {
                        osaHeader = (OsaHeader) packet.getHead();

                        /* get */
                        if (osaHeader.operation == OsaHeader.OPERATION_GET) {
                            System.out.println("OPERATION_GET not supported");

                        /* set */
                        } else if (osaHeader.operation == OsaHeader.OPERATION_SET) {
                            System.out.println("OPERATION_SET not supported");

                        /* log */
                        } else if (osaHeader.operation == OsaHeader.OPERATION_LOG && osaHeader.getNext() instanceof OsaLogHeader) {
                            logHeader = (OsaLogHeader) osaHeader.getNext();

                            System.out.println("Packet OPERATION_LOG!");

                            Object[] data = {logHeader.getTimestampString(), logHeader.getCategoryString(), logHeader.getLevelString(), logHeader.getMessageString()};

                            SwingUtilities.invokeLater(new Runnable() {
                                @Override
                                public void run() {
                                    mainFrame.getLogPanel().getTable().getDefaultTableModel().addRow(data);
                                }
                            });

                        /* log subscribe */
                        } else if (osaHeader.operation == OsaHeader.OPERATION_LOG_SUBSCRIBE) {
                            logSubscribeHeader = (OsaLogSubscribeHeader) osaHeader.getNext();

                            System.out.println("Packet OPERATION_LOG_SUBSCRIBE!");

                            if (logSubscribeHeader.subscribeType == OsaLogSubscribeHeader.SUBSCRIBE_TYPE_GRANT) {
                                System.out.println("subscribe type: SUBSCRIBE_TYPE_GRANT (" + String.format("0x%02x", logSubscribeHeader.subscribeType) + ")");
                                mainFrame.getStateMachine().receiveGrant();

                            } else {
                                System.out.println("subscribe type unknow (" + String.format("0x%02x", logSubscribeHeader.subscribeType) + ")");
                            }

                        } else {
                            System.out.println("operation unknow (" + String.format("0x%02x", osaHeader.operation) + ") or instance wrong");
                        }
                    } else {
                        System.out.println("head not OsaHeader");
                    }
                }
            }
            System.out.println("Socket closed. Exit ReceiveThread");
        } catch (IOException e) {
            System.out.println("IOException. Exit!");
            System.out.println("Message; " + e.getMessage());
            mainFrame.getStateMachine().receiveReject();
            error("IOException", e.getMessage());
        } catch (PacketException e) {
            System.out.println("PacketException. Exit!");
            System.out.println("Message; " + e.getMessage());
            mainFrame.getStateMachine().receiveReject();
            error("PacketException", e.getMessage());
        } catch (InterruptedException e) {
            System.out.println("InterruptedException. Exit!");
            System.out.println("Message; " + e.getMessage());
            mainFrame.getStateMachine().receiveReject();
            error("InterruptedException", e.getMessage());
        }
    }

    private void error(String exceptionName, String exceptionMessage) {
        SwingUtilities.invokeLater(new Runnable() {
            @Override
            public void run() {
                JOptionPane.showMessageDialog(mainFrame, exceptionName + "\n" + exceptionMessage, "Error in Receive Thread", JOptionPane.ERROR_MESSAGE);
            }
        });
    }
